import { 
  BrowserRouter as Router,
  Switch,
  Route,
  Link 
} from "react-router-dom";
import './App.css';
import Homepage from './component/homepage';
import Page1 from './component/page-1';
import Nav from './component/navigation/index';
import Page404 from "./component/page404";
function App() {

  return (
    <Router>
      <div className="App">
        <Nav />
        <Switch>
          <Route path="/" exact component={Homepage}/>
          <Route path="/PageOne" component={Page1}/>
          <Route>
            <Page404 path="*"/>
          </Route>
        </Switch>

      </div>
    </Router>
  );
}

export default App;
